import React from "react";
import SmartTitle from "./SmartTitle";
import ContactInfo from "./ContactInfo";

function ContactoFirstPart(){
    return(
        <div className="contacto-first-part">
            <SmartTitle className="smart-title-left" h3Title="LET'S CREATE SOMETHING GREAT TOGETHER" h1TitleA="CONTACT" h1TitleB="ME"/>
            <ContactInfo className="contact-info"></ContactInfo>
            <div className="black-gradient-bottom"></div>
        </div>

    )
}

export default ContactoFirstPart;
